import React from 'react';
import { BrowserRouter as Router, Switch, Route, Link } from 'react-router-dom'; // Import Link component
import HomePage from './components/HomePage';
import Login from './components/Login';
import Register from './Register';

const App = () => {
  return (
    <Router>
      <Navbar />
      <Switch>
        <Route exact path="/" component={Home} />
        <Route path="/jobseeker/login" component={Login} />
        <Route path="/jobseeker/Register" component={Register} />
        <Route path="/interviewer/login" component={Login} />
        <Route path="/interviewer/register" component={Register} />
      </Switch>
    </Router>
  );
};

export default App;
